INSERT INTO `cake_akazeep`.`aka_posts`(`id`,`keywords`,`correction_image`,`post_image`,`url`,`summary`,`title`,`description`,`correction`,`user_id`,`allow_comments`,`is_published`,`created`,`modified`) VALUES (7,null,null,null,'شرطة_بوسطن_تعتقل_المشتبه_به_الثاني_في_التفجيرات_وتؤكد_1','علنت شرطة مدينة بوسطن الأمريكية، السبت، أن المشتبه به الثاني في تفجيري ماراثون بوسطن رهن الاحتجاز الآن، بعدما تم اعتقاله في وقت مبكر صباح السبت.أضافت الشرطة في تغريدة عبر حسابها الرسمي على موقع ''''تويتر'''': ''''المطاردة انتهت، والإرهاب انتهى، وانتصرت العدالة''''.',' شرطة ''''بوسطن'''' تعتقل المشتبه به الثاني في التفجيرات.. وتؤكد: انتصرت العدالة ',null,null,9,1,0,'2013-04-20 12:33:11','2013-04-20 12:35:56');
INSERT INTO `cake_akazeep`.`aka_posts`(`id`,`keywords`,`correction_image`,`post_image`,`url`,`summary`,`title`,`description`,`correction`,`user_id`,`allow_comments`,`is_published`,`created`,`modified`) VALUES (8,null,null,null,'مصدر_أمني_ارتفاع_عدد_المقبوض_عليهم_في_أحداث_تطهير_القض','ارتفع عدد المقبوض عليهم في اشتباكات جمعة «تطهير القضاء» إلى 39 متهمًا، وقالت التحريات إنهم شاركوا في أعمال الشغب والعنف التي وقعت في شارع رمسيس بداية من كوبري أكتوبر، وإن من بين المقبوض عليهم 3 متهمين بحرق أتوبيس لجماعة الإخوان المسلمين، و16 آخرين ألقوا الحجارة والخرطوش على قوات الأمن.
INSERT INTO `cake_akazeep`.`aka_posts`(`id`,`keywords`,`correction_image`,`post_image`,`url`,`summary`,`title`,`description`,`correction`,`user_id`,`allow_comments`,`is_published`,`created`,`modified`) VALUES (9,null,null,null,'قاضي_خلية_مدينة_نصر_يرفع_الجلسة_بعد_مشادة_مع_المتهمين_ل_1','قرر المستشار شعبان عبد الرحمن الشامي، رئيس الدائرة 15 بمحكمة جنايات شمال القاهرة، رفع أولى جلسات محاكمة 26 متهمًا في قضية خلية مدينة نصر الإرهابية، بعد أن وقعت مشادات كلامية بين المتهمين، والقاضي عقب قراره باحتجاز أحد المتهمين في قفص انفرادي.','قاضي «خلية مدينة نصر» يرفع الجلسة بعد مشادة مع المتهمين لوصفه بـ«الفلول»',null,null,0,1,0,'2013-04-20 12:50:20','2013-04-20 12:50:20');
INSERT INTO `cake_akazeep`.`aka_posts`(`id`,`keywords`,`correction_image`,`post_image`,`url`,`summary`,`title`,`description`,`correction`,`user_id`,`allow_comments`,`is_published`,`created`,`modified`) VALUES (10,null,null,null,'المركزي_لم_نتسلم_وديعة_قطر_ولن_نستنزف_الاحتياطي_للقضا','قال هشام رامز، محافظ البنك المركزي المصري، إن الوديعة القطرية الجديدة البالغة  3 مليارات دولار لشراء سندات، لم تصل مصر بعد، موضحا أنه لم يكن طرفا في الحوار مع قطر أو ليبيا حول المساندة المالية، وأنه كان قد زار قطر قبيل الإعلان عن المساندة للاشتراك في اجتماع مالي عربي، وليس لأي هدف آخر.',' «المركزي»: لم نتسلم وديعة قطر.. ولن نستنزف الاحتياطي للقضاء على السوق السوداء',null,null,0,1,0,'2013-04-20 12:51:55','2013-04-20 12:51:55');
INSERT INTO `cake_akazeep`.`aka_posts`(`id`,`keywords`,`correction_image`,`post_image`,`url`,`summary`,`title`,`description`,`correction`,`user_id`,`allow_comments`,`is_published`,`created`,`modified`) VALUES (11,null,null,null,'اتفاقية-تعاون-إعلامي-بين-التليفزيون-المصري-ونظيره-الت','تم اليوم السبت توقيع اتفاقية تعاون إعلامي بين مصر وتركيا في مجال التبادل الإخباري والبرامجي والدرامي والتقني.','اتفاقية تعاون إعلامي بين التليفزيون المصري ونظيره التركي',null,null,9,1,0,'2013-04-20 19:40:19','2013-04-20 19:40:19');
INSERT INTO `cake_akazeep`.`aka_posts`(`id`,`keywords`,`correction_image`,`post_image`,`url`,`summary`,`title`,`description`,`correction`,`user_id`,`allow_comments`,`is_published`,`created`,`modified`) VALUES (12,null,'518edebe-b83c-44b3-88e5-20f05c0f8f43.jpg','518edebe-3b44-46a7-929f-20f05c0f8f43.jpg','-الادارية-العليا-تؤيد-حكم-وقف-انتخابات-مجلس-النواب--1','قضت دائرة الموضوع بالمحكمة الإدارية العليا برئاسة المستشار يحيى الدكرور، اليوم الأحد، برفض الطعن المقدم من هيئة قضايا الدولة، وكيلاً عن كل من الدكتور محمد مرسى رئيس الجمهورية، والدكتور أحمد فهمي، رئيس مجلس الشورى، والمستشار أحمد مكى وزير العدل، ومحمد العمدة عضو مجلس العب السابق على الحكم الصادر من محكمة أول ',' الادارية العليا تؤيد حكم وقف انتخابات مجلس النواب ',null,null,517,1,0,'2013-04-21 19:03:22','2013-05-12 02:13:50');
INSERT INTO `cake_akazeep`.`aka_posts`(`id`,`keywords`,`correction_image`,`post_image`,`url`,`summary`,`title`,`description`,`correction`,`user_id`,`allow_comments`,`is_published`,`created`,`modified`) VALUES (13,null,'51742c02-7754-415c-8f28-07045c0f8f43.jpg','51742c02-3e14-4296-8cbc-07045c0f8f43.jpg','قاضي-رفض-ممثل-النيابة-التفتيش-القضائي-تفهم-موقفي-وانته-1','أكد المستشار رواد محمد حما، القاضي بمحكمة الجنح، أنه أدلى بأقواله اليوم الأحد، أمام جهاز التفتيش القضائي بوزارة العدل، على خلفية استدعائه للتحقيق بعد أن أصدر قراراً ببطلان انعقاد أحد الجلسات لبطلان تمثيل النيابة العامة لصدر حكم من دائرة طلبات رجال القضاء ببطلان تعين المستشار طلعت إبراهيم النائب العام في منصبه.','قاضي ''''رفض ممثل النيابة'''': التفتيش القضائي تفهم موقفي وانتهى الأمر',null,null,0,1,0,'2013-04-21 20:12:18','2013-04-21 20:12:18');
